import React, { useState } from 'react';

function ReserveTutorPage() {
  const [formData, setFormData] = useState({
    tutor_id: '',
    student_id: '',
    date: '',
    subject_id: '',
    time: '',
    duration: '',
    status: 'Incomplete'
  });

  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    fetch('https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/Create/reservations', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        body: formData
      })
    })
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(error => console.error(error))
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Tutor ID:
        <input type="text" name="tutor_id" value={formData.tutor_id} onChange={handleChange} />
      </label>
      <br />
      <label>
        Student ID:
        <input type="text" name="student_id" value={formData.student_id} onChange={handleChange} />
      </label>
      <br />
      <label>
        Date:
        <input type="date" name="date" value={formData.date} onChange={handleChange} />
      </label>
      <br />
      <label>
        Subject ID:
        <input type="text" name="subject_id" value={formData.subject_id} onChange={handleChange} />
      </label>
      <br />
      <label>
        Time:
        <input type="time" name="time" value={formData.time} onChange={handleChange} />
      </label>
      <br />
      <label>
        Duration:
        <input type="text" name="duration" value={formData.duration} onChange={handleChange} />
      </label>
      <br />
      <input type="submit" value="Submit" />
    </form>
  );
}

export default ReserveTutorPage;
